ConstValues.value:
"<html>
    <!-- WKWebView-specific metadata -->
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <head>
        <style>
            /* Remove any default padding */
            * {
                margin:    0px;
                padding:   0px;
            }
            /* Aspect-fit the ECC card to the width of its container */
            img {
                max-width: 100%%;
                width:     100%%;
                height:    auto;
            }
        </style>
    </head>
    <body>
        <center>
            <!-- The id is used to locate the element once the image has loaded -->
            <img id="card" src="%@">
        </center>
    </body>
</html>"
